const homeBodyStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const HomeBodyStyle = (
  <div style={homeBodyStyle}>
    <div>
      <h1>Meditation</h1>
    </div>
    <div>
      <h1>Schedule</h1>
    </div>
    <div>
      <h1>Reach Out</h1>
    </div>
    <div>
      <h1>Choco Project</h1>
    </div>
  </div>
);

export default HomeBodyStyle;
